declare (strict_types=1);

namespace onOffice\tests;

use onOffice\SDK\onOfficeSDK;
use onOffice\tests\SDKWrapperMocker;
use onOffice\WPlugin\API\ApiClientActionGetPdf;
use WP_UnitTestCase;

/**
 *
 * @url http://www.onoffice.de
 * @copyright 2003-2018, onOffice(R) GmbH
 *
 */

class TestClassAPIClientActionGetPdf
	extends WP_UnitTestCase
{
	/**
	 *
	 */

	public function testSendRequest()
	{
		$pApiCall = $this->sendRequest($this->getResponseGetByRecordId());

		$this->assertTrue($pApiCall->getResultStatus());
		$this->assertEquals($this->getExpectedRecordResult(), md5($pApiCall->getResultRecords()[0]));
	}


	/**
	 *
	 * @param array $apiResult
	 * @return ApiClientActionGetPdf
	 *
	 */

	private function sendRequest(array $apiResult)
	{
		$pSDKMocker = new SDKWrapperMocker();
		$pApiCall = new ApiClientActionGetPdf($pSDKMocker, onOfficeSDK::ACTION_ID_GET, 'pdf');
		$parameters = array(
			'estateid' => 5545,
			'language' => 'DEU',
			'gzcompress' => true,
			'template' => 'urn:onoffice-de-ns:smart:2.5:pdf:expose:kurz:design01Aushang',
		);
		$pApiCall->setParameters($parameters);
		$pApiCall->addRequestToQueue();
		$pSDKMocker->addResponseByParameters
			(onOfficeSDK::ACTION_ID_GET, 'pdf', '', $parameters, null, $apiResult);

		$pSDKMocker->sendRequests();

		return $pApiCall;
	}


	/**
	 *
	 * @expectedException \onOffice\WPlugin\API\APIEmptyResultException
	 *
	 */

	public function testSendRequestEmptyResponse()
	{
		$pApiCall = $this->sendRequest(array());
		$this->assertFalse($pApiCall->getResultStatus());
		$pApiCall->getResultRecords();
	}


	/**
	 *
	 * @return string the MD5 sum of expected document
	 *
	 */

	private function getExpectedRecordResult()
	{
		return '87974db6c1f9975f572bfdb8a60d5cdc';
	}


	/**
	 *
	 * @return string
	 *
	 */

	private function getResponseGetByRecordId()
	{
		return array (
			'actionid' => 'urn:onoffice-de-ns:smart:2.5:smartml:action:get',
			'resourceid' => '',
			'resourcetype' => 'pdf',
			'cacheable' => true,
			'identifier' => NULL,
			'data' => array(
				'meta' => array(
					'cntabsolute' => NULL,
				),
				'records' => array(
					0 => array(
						'id' => 0,
						'type' => 'pdf',
						'elements' => array(
							'type' => 'application/pdf',
							'document' => '',
						),
					),
				),
			),
			'status' => array(
				'errorcode' => 0,
				'message' => 'OK',
			),
		);
	}
}
